import React from 'react';

const date = '123'
const total = 1000
function Frame6(props) {
    return (
        <div className='Frame6'>

            <div className='Frame6-Content'>
                <p>{date}</p>
                <p>{total}</p>
                <div className='Frame6-Icon' >
                    <i class="fa-solid fa-gear"></i>
                </div>
            </div>

        </div >
    );
}

export default Frame6;
